import React from 'react';


class signUpForm extends React.Component {

   constructor(props) {
       super(props)
       this.state = {
           name: '',
           password: '',
           medicid: '',
           email: '',
           cellphone: ''
       }
   }

   handleChange(e) {
       this.setState({
           value: e.target.value
       });
   }

   handleSubmit(e) {
       e.preventDefault();
   }

    render() {
        return (
            <div className="loginForm">
                <form>
                    <label htmlFor="nameInput">
                      Name
                      <input 
                        id="nameInput"
                        name="name"
                        type="text" 
                        value={this.state.value}
                        onChange={this.handleChange}
                      />
                    </label>
                    <label htmlFor="emailInput">
                      Email
                      <input 
                        id="emailInput"
                        name="email"
                        type="email" 
                        value={this.state.value}
                        onChange={this.handleChange}
                      />
                    </label>
                    <label htmlFor="cellphoneInput">
                      Cellphone #
                      <input 
                        id="cellphoneInput"
                        name="cellphone"
                        type="number" 
                        value={this.state.value}
                        onChange={this.handleChange}
                      />
                    </label>
                    <label htmlFor="medicIdInput">
                      MedicId
                      <input 
                        id="medicIdInput"
                        name="medicid"
                        type="number" 
                        value={this.state.value}
                        onChange={this.handleChange}
                      />
                    </label>
                    <label htmlFor="passwordIdInput">
                      Password
                      <input 
                        id="passwordIdInput"
                        name="password"
                        type="password" 
                        value={this.state.value}
                        onChange={this.handleChange}
                      />
                    <input
                       type="submit"
                       value="Submit"
                    />
                    </label>
                </form>
            </div>
        )
    }
}

export default signUpForm;
